query:
fragment WebhookFragment on Webhook {
  id
  name
  isActive
  app {
    id
    name
    __typename
  }
  __typename
}

query WebhookDetails($id: ID!) {
  webhook(id: $id) {
    ...WebhookFragment
    events {
      eventType
      __typename
    }
    secretKey
    targetUrl
    __typename
  }
}
